import './Tile.css'
import React from 'react'

function Tile({ sum }) {

    let color
    if (sum % 2 === 0) {

        color = "black-tile"

    } else {

        color = "white-tile"

    }

    return(

        <div classname={color} />

    )

}

export default Tile
